import React from 'react';
import {Link} from 'react-router-dom';
// Styles
import './NavBar.css';

export const NavBar = () => {
  return (
    <nav>
      <span>
        <p>
          <Link to='/' className='a'>Home</Link>
          <Link to='/join' className='a'><p>Join a club</p></Link>
          <Link to='/contact' className='a'>Contact us</Link>
        </p>
      </span>
    </nav>
  );
}
